sections.css:
$o-button: '.o-button';

%button {
    padding: 12px 30px;
    display: inline-block;
    font-weight: 500;
    font-size: 14px;
    line-height: $lineHeight-tight;
    letter-spacing: 1.75px;
    text-align: center;
    text-transform: uppercase;
    border-radius: 2px;
    transition: background-color 200ms ease;
}

#{$o-button} {
    @extend %button;
    color: $colors-white;
    background-color: $colors-white;

    &:hover {
        color: $colors-white;
        background-color: $colors-white;  
    }

}

#{$o-button}-gray {
    @extend %button;
    color: $colors-white;
    background-color: $colors-gray-2;

    &:hover {
        color: $colors-gray-2;
        background-color: $colors-white;  
    }
}

#{$o-button}--small {
    padding: 12px 16px;
}

$o-heading: '.o-heading';

#{$o-heading}-1 {
    color: $colors-white;
    font-weight: 300;
    font-size: $fontSize-14;
    line-height: $lineHeight-tight;
    text-transform: uppercase;

    @include media('>=md') {
        font-size: $fontSize-20;
    }

    strong {
        color: $colors-blue-1;
        font-weight: 300;
    }

}

$o-link: '.o-link';

#{$o-link} {
    color: $colors-blue-1;
    font-weight: 500;
    font-size: $fontSize-7;
    letter-spacing: 0.1em;
    text-transform: uppercase;

    &:hover {
        text-decoration: underline;
    }

}

$o-text: '.o-text';

#{$o-text} {
    color: $colors-gray-4;
    font-weight: 500;
    font-size: $fontSize-8;
    line-height: $lineHeight-snug;

    @include media('>=md') {
        font-size: $fontSize-10;
    }

    p {

        &:not(:last-child) {
            margin-bottom: $lineHeight-snug * 10px;
        }
    }

}

#{$o-text}--light {
    font-weight: 300;
    line-height: $lineHeight-snug;

    p {

        &:not(:last-child) {
            margin-bottom: $lineHeight-snug * 10px;
        }
    }


}

$o-container: '.o-container';

#{$o-container}-large {
    @include center();
    max-width: $maxWidth-large;
}

#{$o-container}-xlarge {
    @include center();
    max-width: $maxWidth-xlarge;
}

#{$o-container}-wide {
    @include center();
    max-width: $maxWidth-wide;
}

#{$o-container}-site {
    @include center();
    max-width: $maxWidth-site;
}

#{$o-container}-xsite {
    @include center();
    max-width: $maxWidth-xsite;
}

@mixin container-padding-responsive() {
    padding-right: 20px;
    padding-left: 20px;

    @include media('>=md') {
        padding-right: 25px;
        padding-left: 25px;
    }

}

@mixin container-padding-responsive-left() {
    padding-left: 20px;

    @include media('>=md') {
        padding-left: 25px;
    }

}

@mixin container-padding-responsive-right() {
    padding-right: 20px;

    @include media('>=md') {
        padding-right: 25px;
    }

}

.o-release {
    margin-right: calc(-50vw + 50%);
    margin-left: calc(-50vw + 50%);
}

